- input: "TEXT\x1CC00030718\x1C1\x1C\x1CF3XA\x1C5/13/2011:  We are in receipt of the
    Commission letter inquiry of 4/12/11 requesting additional information for two
    items reported on our Post General report (10/14/11-11/22/11).  Please be advised
    we are amending this report to include additional descriptive details for the
    entries related to the $3,000 refund from Feingold Senate Committee reported on
    Line 16 and the $1,532.54 interest receipt from the Federal Home Loan Bank Board
    reported on Line 17.  All other aspects of this report remain unchanged. The 10/22/10
    refund of $53,507.00 from Thompson Communications Inc and reported on Line 15
    relates to TV costs originally paid for an independent expenditure disseminated
    on 10/15/10 for Johnny Isakson.  For the contra disbursement amounts reported
    on Line 21b and transferred to Line 24 of this report for Thompson Communications
    ($336,845.00 for TV ad costs) and Public Opinion Strategies LLC ($37,000 for survey
    costs), the full purpose of disbursement should be noted as: Independent Expenditure
    disseminated, see Line 24 item. These amounts relate to advance costs for independent
    expenditures that were originally reported as positive entries on Line 21b of
    previous monthly reports (see our September and Pre-General 2010 monthly reports).
    \  For the Line 24 corresponding positive entries, the full purpose of disbursement
    for each is:  Transfer costs from Line 21b to Line 24 due to public dissemination
    of independent expenditure communication.  Items are:  Thompson Communications
    on 10/15/10 for TV ad costs of $336,845.00 for Johnny Isakson; Public Opinion
    Strategies LLC on 10/15/10 for survey costs of $37,000.00 for Johnny Isakson.
    For the contra disbursement entries for the National Association of Realtors that
    are reflected on Line 21b of this report on the dates of 10/15/10 and 10/25/10,
    and which total $200, with the explanation each is transferred to Line 24 of this
    report, the full purpose of disbursement should be noted as: Independent Expenditure
    disseminated, see Line 24 item.  These amounts relate to an original $6,900 advance
    payment made to the National Association of Realtors for consulting services on
    9/13/10 & reported on Line 21b of the October 2010 monthly report.  $200.00 is
    being utilized as consulting services attributable to independent expenditures
    in this period with the full purpose of disbursement for each positive entry for
    National Association of Realtors on Line 24 as: Transfer consulting services from
    Line 21b to Line 24 due to public dissemination of independent expenditure communications.
    \  Line 24 entries are attributable as follows: $100.00 on 10/15/10 for Johnny
    Isakson; $100.00 on 10/25/10 for Paul Kanjorski. For Line 22 of this report, the
    disbursement to Minnesota RPAC for $18,931.28 on 11/16/2010 represents a refund
    for a transmission of funds inadvertently sent in error by the affiliated committee
    and the disbursement to Washington RPAC for $300.00 on 10/22/2010 represents a
    refund for a transmission of funds inadvertently sent in error by the state agent.
    \ \n"
